import React from 'react';
import './App.css';

// Function to simulate getting GPS coordinates
const getLocation = () => {
  // Generating random coordinates for simulation purposes
  const latitude = (Math.random() * 180 - 90).toFixed(6);
  const longitude = (Math.random() * 360 - 180).toFixed(6);
  return { latitude, longitude };
};

// Function to open Google Maps with the given coordinates
const openMap = (memberName) => {
  const { latitude, longitude } = getLocation();
  console.log(`${memberName}'s location: Latitude: ${latitude}, Longitude: ${longitude}`);
  // Open Google Maps with the generated coordinates
  const url = `https://www.google.com/maps?q=${latitude},${longitude}`;
  window.open(url, '_blank');
};

function App() {
  // Family members list
  const familyMembers = ['Alice', 'Bob', 'Charlie', 'Diana'];

  return (
    <div className="App">
      <h1>Family Location Tracker</h1>
      <div className="buttons">
        {familyMembers.map((member, index) => (
          <button key={index} onClick={() => openMap(member)}>
            Track {member}
          </button>
        ))}
      </div>
    </div>
  );
}

export default App;
